import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './components/Home';
import About from './components/About';
import Users from './components/Users';
import NoteState from './contexts/notes/NoteState';
import Alert from './components/Alert';
import Login from './components/Login';
import Signup from './components/Signup';
import { useState } from 'react';

function App() {

  return (
    <>
      <NoteState>
        <Router>
          <Navbar />
          <Alert/>
          <div className="container">
            <Routes>
              <Route strict path='/' element={<Home/>}> </Route>
              <Route strict path='/about' element={<About />}> </Route>
              <Route strict path='/users' element={<Users />}> </Route>
              <Route strict path='/login' element={<Login showAlert={showAlert}/>}> </Route>
              <Route strict path='/signup' element={<Signup showAlert={showAlert}/>}> </Route>

            </Routes>
          </div>
        </Router>
      </NoteState>
    </>
  );
}

export default App;
